import React from 'react'

export function UsersModal({ users }) {
    return (
        <div className="user-modal">
            <div className="flex col users-list-modal">
                {users?.map(user => {
                    return <div
                        key={user._id}
                        className="user flex align-center" >
                        <img className="img-users" src={user.color} />
                        <a>{user.name}</a>
                    </div>
                })}
            </div>
            <div className="bottom flex col">
                <a>Account</a>
                <a>Help</a>
                <a>Logout from Netflix</a>
            </div>
        </div>
    )
}
